import React from 'react';
import { Button, Text, View, Image, StyleSheet } from 'react-native';
import { userApi } from '../../services/user';
import {img} from "../../../assets/titleIMG.png";


function RtkQueryPage({ navigation }) {
  const {
    data,
    error,
    isLoading,
    isFetching,
    isSuccess,
  } = userApi.endpoints.usersGet.useQuery();

  return (
    <View>

      <View style = {styles.IMGContainer}>
      <Image source={img} />
      </View>

      <Button
        title="Go home"
        onPress={() => navigation.navigate('Home')}
      />
      <Text>RTK Query Demo</Text>
      {isSuccess && data.data.map((s, index) => (
        <View key={index}>
          <Text>{s.username}</Text>
          <Text>{s._id}</Text>
        </View>
      ))}
    </View>
  );
}

const styles = StyleSheet.create({
  IMGContainer: {
    position: 'absolute',
    width: 152,
    height: 201,
    left: 138,
    top: 224,
  }
});

export default RtkQueryPage;
